import myImage from './home_icon.png';
import "./css/aside.css"

function Aside(){
    return(
        <aside>
            <div className='aside_container'>
                <nav>
                    <li>
                        <p>Каталог</p>
                    </li>
                    <li>
                        <p>Форум</p>
                    </li>
                    <li>
                        <p>Поддержка</p>
                    </li>
                </nav>
            </div>
        </aside>
        );
}

export default Aside;
